(308, 'Rebeccasnurb', 'dar.frantz@yandex.com', 'Строительные туры (вышки-туры) используются ради работ ради высотах, где применение классических лестниц как стремянок опасный и в случаях, если строительные материалы и инструмент обязан разместить прямо в зоне работ. \r\n \r\nЭти конструкции применяются в очень многих сферах, то пить повсеместно где необходим доступ для высоту - монтаж, электромонтаж, строительные, ремонтные, фасадные работы. Используется ради съемочных площадках, для замены ламп, киносъемки и установке осветительного оборудования, обслуживания станков, авиастроения, вагоностроения, кораблестроения. В зависимости от условий эксплуатации в производстве используют разные материалы для изготовление вышек-тур: сталь, алюминий, стекловолокно. \r\nОсновные технические характеристики вышек-тур: грузоподъёмность, общая высота, высь установки рабочей площадки, габаритные размеры рабочей площадки. \r\nГрузоподъемность: Благодаря 150 накануне 250 кг/м2. \r\nПредлагаем ознакомится: <a>вышка тура строительная передвижная купить в минске с доставкой</a> \r\nГрадус использования: посредством 3 заранее 21,8 м рабочей гора (рабочая уровень - степень доступа для которой проводятся работы). \r\n \r\nГабаритные размеры: ширина и длина площадки зависит вследствие требования к рабочей высоте и нагрузке. Ширина настила может оставаться от 0,5 накануне 2,0 м, а длина настила чрез 1,5 накануне 3,0 м. \r\nСмотрите также: \r\nhttps://ok.ru/group/56574637375561 \r\nhttps://vk.com/vyshki_tur \r\nhttps://rinstroy.blogspot.com', '2020-10-18 05:37:39'),
