(318, 'LindaBah', 'kilinjeaharikan4590@gmail.com', 'Главный американский эксперт по вирусам доктор Энтони Фаучи разбранил Белый дом за проведение мероприятия, в связи со вспышкой Covid-19. \r\nПрофессор Фаучи, член целевой группы Белого дома по коронавирусу, сказал, что обнародование кандидатуры президента Дональда Трампа в Верховный суд было \"суперпредсказуемым событием\". \r\nПо крайней мере, одинадцать человек, посетивших мероприятие 26 сентября, показали положительный тест. \r\nСам Трамп выздоравливает от коронавируса. \r\nЕго врачи только что дали добро ему проводить общественные собрания, менее чем за месяц до того, как он встретится с кандидатом от демократической партии Джо Байденом на президентских выборах. \r\nМр. Трамп негативно относится к таким мерам, как маски и блокировка, для борьбы с распространением вируса, от которого погибло более 213000 человек в США. Он говорил о возможностях создания лекарства, хотя исследователи говорят, что это вряд ли произойдет раньше грядущего года. \r\nГолосование показало, что г-н Байден обгоняет Трампа на одну цифру, а опрос ABC News / Ipsos показал, что только 35% американцев одобряют то, как Трамп справился с кризисом. \r\nВторые президентские дебаты через несколько дней между Трампом и его кандидатом от демократов в Белом доме Джо Байденом отклонены. \r\nКомиссия по президентским дебатам заявила в заявлении в пятницу, что обе кампании объявили «альтернативные планы на эту дату». \r\nГ-н Трамп отклонил по просьбе комиссии прокурировать вскрытие 15 октября практически, чтобы минимизировать риск распространения COVID-19. \r\nКомиссия заявила, что все еще готовится к третьим и заключительным президентским дебатам в Нэшвилле, штат Теннесси, 22 октября. \r\nВ кампании Трампа указывалось, что комиссия была не честной по отношению к Байдену, а штат Демократической партии обвинил президента в том, что он уклонился от дебатов. Информацию предоставил <a>https://rctrust.top</a>', '2020-10-18 19:23:05'),
