(809, 'CharlesVog', 'okjuk08@mail.ru', 'НПФ \"АНАТЭК\" специализируется на разработке, производстве и продаже портативных аналитических приборов и оборудования для экологического контроля. Наши приборы максимально просты и удобны в использовании. Широкий диапазон измеряемых концентраций и высокая чувствительность позволяет определять состав и концентрацию примесей в атмосфере, воде и почве от ПДК атмосферы и рабочей зоны до величин промвыбросов. Вы легко и быстро сможете определить очаг выброса, локализовать загрязненную территорию, определить состав и концентрацию загрязняющих компонентов.  \r\n<a>https://www.anatek.ru</a> Все методики выполнения измерений МВИ для ФГХ-1 являются действующими и для модели ФГХ-2(А). Кроме того, разработаны, аттестованы и внесены в реестр новые методики МВИ для перечня дополнительных веществ, которые позволяют значительно расширить область применения ФГХ-2(А). \r\nМодель ФГХ-2(А) также может быть реализована в двухканальном исполнении(2К). Такой хроматограф имеет два независимых канала отбора и ввода анализируемой пробы, в прибор устанавливаются две разделительные хроматографические колонки, которые подключаются оператором из программы в зависимости от перечня определяемых веществ.  Фактически, модель ФГХ-2(А) в двухканальном исполнении - это два хроматографа, совмещенные в одном приборе, что позволяет на одном приборе определять вещества, которые невозможно измерить на одноканальном(с одной разделительной колонкой) хроматографе. Например, это задача определения фенола-формальдегида, анилина, уксусной кислоты и т.п. \r\nДетектор с Ар в ФГХ-2(А) позволил существенно понизить порог определения многих веществ, которые ФГХ-1 определял только на уровне ПДК рабочей зоны. Хроматограф ФГХ-2(А) доступен в обычном и ударопрочном исполнении. Гарантия на прибор составляет 1 год. Принимаются предварительные заявки.', '2020-12-05 23:10:42'),
