(823, 'Antonioknilk', 'asemchikova@mail.ru', 'Шторы блэкаут – это шторы из светонепроницаемой ткани, блокирующие свет на 70 -100 %. \r\nБлэкаут бывает двух видов: 1.Трехслойная ткань из 100% полиэстера. Лицевая сторона – однотонная или с рисунком, второй, внутренний слой из черных нитей и третья изнанка нейтрального цвета. 2.Ткань с пропиткой по изнаночной стороне из акрила или силикона. \r\n \r\nБлэкаут можно использовать и как самостоятельную портьеру, и в виде подклада к любой понравившейся ткани.  \r\n<a>https://art-shtora.ru</a> В оформлении детской комнаты популярны следующие стили: \r\n \r\n1.Классичечкий стиль \r\nВ основном, это прямые шторы, собранные по бокам подхватами или декоративными кистями. Края штор можно украсить тесьмой с кисточками. Подойдут шторы с ламбрекеном. Используют однотонные ткани или с классическим рисунком. \r\n \r\n2. Стиль прованс. \r\nТекстильное оформление в этом стиле предполагает мягкие складки, рюши, отделку тесьмой с помпонами. Уместны австрийские или французские шторы. Пастельные тона, натуральные материалы. \r\nЭтот стиль очень подходит маленьким принцессам. \r\n \r\n3.Морской стиль \r\nМногим мальчикам нравится оформление в морском стиле. Желательно использовать натуральные материалы полотняного переплетения. Гамма сине-белая, песочные оттенки, возможно присутствие красного цвета. \r\n \r\n4.Современный стиль. \r\nСтрогие линии и функциональность! Хорошо подойдут рулонные и римские шторы , шторы на люверсах и петлях. \r\nВ независимости от выбранного стиля, особенно для самых маленьких, в детской нужно создать условия для дневного сна. С этой задачей справятся шторы из блекаута. Чтобы не нарушить стилистику, блекаут используют как подкладку для штор.', '2020-12-07 00:47:37'),
