(879, 'Josephcex', 'svmit10@mail.ru', 'Реставрация старой мебели \r\nПроще всего отреставрировать корпусную мебель - шкафы, полки, столы, стулья и другую обстановку наших квартир и офисов, потому что ремонт ее заключается только в столярных работах. Но проще, не значит просто. Как и в любом другом деле, реставрация старинной мебели требует определенной квалификации мастеров, которые не просто механически выполняют определенные действия, а делают свою работу с истинным умением.  \r\n<a>http://www.kabryol.ru/</a> Реставрация антикварной мебели \r\nРеставраторов всегда считали особыми людьми (ведь их работа - искусство) , немного странными, но очень интересными, ведь они видят в потертых старых стульях и шкафах потенциальных «киентов», которым можно помочь вернуть былое очарование. Реставрация антикварной мебели, картин и прочего - это их работа, к которой они относятся с трепетом, будто у каждой вещицы есть своя душа. Некоторые реставраторы творят историю: восстанавливают произведения искусства, работают с предметами, найденными вследствие раскопок, восстанавливают по крупицам представление о быте давно ушедших народов и культур. Хорошие реставраторы - это очень талантливые люди, которые порой творят настоящие чудеса.', '2020-12-10 06:05:24'),
