(896, 'EddiePinly', 'svrez09@mail.ru', 'Наша цель – выйти за рамки обычного понимания лакокрасочного предприятия и стать промышленным объединением современных идей \r\n \r\nи передовых технологий. \r\n \r\nНаша стратегия – преображать рынок строительных материалов своими \r\n \r\nразработками, чувствуя запросы конечного потребителя. \r\n \r\nМы будем рады видеть ВАС у нас в гостях и рассмотрим любые предложения по долгосрочному и плодотворному сотрудничеству! \r\n \r\nС уважением коллектив «КРАСМА»  \r\n<a>http://krasma2002.ru/emal-hv---16</a> Краска «Акриал» (АК-124) применяется для окраски кирпичных, бетонных, пенобетонных и т.п. поверхностей, как снаружи, так и внутри помещений (кроме путей эвакуации). Эмаль можно наносить и на известковые, асбоцементные, оштукатуренные поверхности, по старой, плотно держащейся на поверхности акриловой или водоэмульсионной краске. При окраске происходит образование «дышащего», водоотталкивающего лакокрасочного покрытия. Данная фасадная эмаль - это суспензия пигментов и наполнителей в акриловом лаке с введением целевых добавок и органических растворителей. Возможен выпуск широкой цветовой гаммы краски «Акриал»( АК-124), что удовлетворит потребности любого клиента. После высыхания покрытие не представляет вреда для здоровья человека, а используемое в производстве высококачественное сырье обеспечивает превосходные показатели краски для покраски фасадов.', '2020-12-11 05:22:44'),
