(980, 'WinnerruPl', 'pobeditelmoskva@gmail.com', '<a>Как проснуться миллионером: история одного москвича</a> \r\nПредставьте: вы просыпаетесь, как обычно проверяете входящие смс-уведомления на телефоне и обнаруживаете, что вдруг стали миллионером. \r\nИменно это случилось в среду с Сергеем Л. из Москвы. \r\nПричиной всему супервыигрышная Американская игра Powerball, в которой Сергей выиграл приз в $ 35 000, что в российской валюте примерно 2.6 миллиона. \r\n \r\nСказать, что счастливый москвич был шокирован этой новостью, — это ничего не сказать! \r\n\"Утром, как обычно, пришло оповещение на почту (у меня все в телефоне). Так как не крупных выигрышей куча, я подумал, опять \"семечки\" пришли. \r\nСмотрю и не верю своим глазам, думал, ошибка, захожу в кабинет на сайте — нет, не ошибка!\" — рассказал Сергей сервису Lotto Agent, с помощью которого и сделал ту самую выигрышную ставку. \r\n \r\nА от выигрыша главного приза в $ 231 000 000 победителя отделял всего лишь один не угаданный номер. \r\nСправа — кадр из официального видео розыгрыша Powerball, слева — скриншот ставки Сергея. Сергей не угадал только одно число в комбинации - 40. \r\n \r\n\"В чем секрет Сергея?\" — спросите вы. \r\nВ выборе номеров ему не помогала ни нумерология, ни магия, ни математика. \r\nВсе оказалось значительно проще — выигрышные номера за Сергея выбрала функция - \"Авто-выбор\". \r\n \r\nПобедитель рассказывает, что совсем не планировал принимать участие в том розыгрыше: \r\n\"Самое удивительное, что именно в этой лотерее я не собирался участвовать — вот хочешь верь, хочешь нет. \r\nЧто-то нашло вечером, пять секунд — и дело сделано\". \r\n \r\nКакой же он, счастливый победитель? \r\nОказывается, обычный человек, похожий на каждого из нас: \r\n\"Я работаю ведущим специалистом на производственном предприятии, жена — врач и маленький сынишка. \r\nМы живём как все обычные семьи — занимаемся спортом, выезжаем на природу на барбекю. \r\n \r\nИзучаем и читаем классическую литературу. Я в данный момент ещё занимаюсь Английским онлайн.\" \r\nПриличный приз пришёлся Сергею очень кстати, ведь это ещё одна возможность по-особенному поздравить своих родных с Новым Годом: \r\n\"Я никому не сообщаю из близких, потому что люблю делать подарки и сюрпризы — я хочу всех поздравить с Рождеством, как они этого не ожидали!\" \r\nНикаких грандиозных трат счастливый победитель пока не планирует: долю выигрыша хочет отдать нуждающимся, а другую часть вложить в акции. \r\n \r\n*** \r\nКаждый хотел бы хоть на секунду очутиться на месте Сергея! \r\nК счастью для всех нас, розыгрыши Powerball не заканчиваются — совсем скоро будет разыгран Джек-пот свыше $ 250 000 000. \r\nЭта Американская игра подарила миллионы долларов уже многим игрокам, а Сергея она сделала обладателем крупнейшего выигранного приза на территории России. \r\nИнтересно, кто сможет побить его рекорд? \r\n', '2020-12-20 10:15:34'),
