(1662, 'Zamkihes', 'infoPaita@admin.mailru.pp.ua', 'Здравствйте! \r\n<a><img src=\"https://vigodabel.com/wp-content/uploads/2018/08/nasayt.png\"></a> \r\n \r\n<a><img src=\"https://zamenazamkov.com/wp-content/uploads/2016/04/поменять-личинку-замка-в-металлической-двери.jpg\"></a> \r\n \r\nУ вас квартира, частный дом, офис или предприятие? Мы работаем со всеми видами замковых устройств, включая секретные и электронные механизмы, и выполняем работу качественно, быстро и бюджетно. Нужно поменять замок в металлической железной двери? Стоимость работы зависит от типа замкового устройства и сложности работы — чем выше секретность, тем сложнее монтаж. Покупать ничего не нужно. В наличии у мастеров более моделей современных замков отечественных и импортных производителей для любых существующих дверей. В металлическую дверь вместо старого или неисправного замка можно установить только точно такой же замок или его аналог, который подходит по размерам и креплениям. Мастер предложит все возможные варианты и поможет в выборе замка. Сувальдные замки обладают более высокой степенью защиты и стойкостью ко взлому. Оптимальным вариантов является установка двух замков разного типа, или двухсистемного замка, включающего как сувальдный, так и цилиндровый механизмы. Мы работаем круглосуточно, без выходных. В срочном порядке мастер приезжает на вызов в течение минут после звонка, либо можно договориться на любое удобное для вас время? Да, конечно. Мы устанавливаем только оригинальные дверные замки от производителей. Кроме этого, предоставляем увеличенную гарантию от 2х лет на отечественные до 4х лет импортные замки. В случае наступления любых неисправностей в течение гарантийного срока - приезд мастера, работа по замене и непосредственно новый замок предоставляются бесплатно. Расчет ориентировочный. Точную стоимость сообщит оператор или мастер при уточнении деталей. Оставьте телефон, мы перезвоним в течение 1 минуты и приедем в течение 20 минут. Замена замка на входной металлической двери