(1725, 'mirpromlDex', 'mir2017alfa@gmail.com', 'Система предоставляет возможность Партнерам и Пользователям выполнять операции посредством обращения к REST сервисам, используя OAuth2 токен в качестве средства аутентификации. Все действияСистема предоставляет возможность Партнерам и Пользователям выполнять операции посредством обращения к REST сервисам, используя OAuth2 токен в качестве средства аутентификации. Все действия пользователя осуществляются посредством мобильного приложения или web-приложения Партнера. В пределах этой версии в сервисах уже существующие поля в JSON телах запросов ответов не меняются не удаляются не переименовываются , <a>документация</a>. Ендпоинты сервисов, параметры строки запроса, заголовки запросов ответов также остаются неизменными. В пределах версии тем не менее возможно добавление новых полей в тела ответов запросов, добавление новых параметров запроса и добавление новых сервисов. Пользователь, осуществляющий операцию, может быть как зарегистрирован на стороне Партнера, так и не зарегистрирован. Для каждой из этих ролей предусмотрен свой токен партнерский и пользовательский соответственно, использование которых авторизует клиента в системе. Токен, который выпускается к партнерскому токену, служит для разграничения Пользователей и каналов Партнера и позволяет выполнять следующие операции через UAPI . Используя партнерский токен нельзя, например, осуществить перевод по шаблону, созданному с помощью пользовательского токена, и наоборот, т. Если выполнить создание шаблона под разными токенами у этих шаблонов будут разные ID, привязанные строго к своим токенам. На текущий момент партнерский токен не может запрашивать список своих операций, но в будущем мы планируем это исправить. Если на витрине Партнера есть переводы для всех посетителей, необходимо использовать партнерский токен. Пользователи с разных площадок не пересекаются между собой и каждая площадка имеет доступ только к своим данным. Если на витрине Партнера есть переводы для зарегистрированных пользователей Сбор средств на подарки проекты, как вариант . При регистрации Пользователя в системе UAPI на основе логина и пароля Партнер генерит ключ Basic авторизациии отправляет запрос на генерацию пользовательского токена. Получение пользовательского токена состоит из двух частей получение одноразового пароля через sms и получение самого токена по одноразовому паролю. Для совершения операций в UAPI от лица Пользователя Партнеру необходимо иметь актуальный пользовательский токен. \r\n \r\nЧто можете посоветовать?', '2021-03-04 09:17:06'),
