(2006, 'DavidHat', 'cr4fterminer@yandex.com', '<a><img src=\"http://dfc-co.com/wp-content/uploads/2018/04/48-1.jpg\"></a> \r\n<a>расходомеров micro motion</a> MICRO MOTION (Brand of Emerson) О компании. Компания Micro Motion существует более 25 лет и выступает беспринципным лидером в технологиях измерений. Ежегодно производятся десятки тысяч самодренируемых приборов учета расхода и плотности, которые отличаются универсальностью, компактностью и возможностями создавать целые системы измерений расходной среды. Продукция МАЙКРО МОУШН (брэнд оф Эмэрсон) Трансмиттеры. Одним из компонентов расходомера является трансмиттер. Производитель предлагает несколько вариантов этого устройства. Серии трансмиттеров Micro Motion 1000 и 2000 на базе технологии MVD, дающих снижение итоговых затрат за счет повышения технологичности процесса. Модели 1000 могут измерять массовый и объемный расход. Модели 2000 включают массовый и объемный расход, плотность, температуру, усиление. Трансмиттеры моделей 1700 и 2700 с возможностью поворота на 360° и быстрым определением состоянии расходомера. Трансмиттеры моделей 1500 и 2500 с низким потреблением энергии. Расходомеры и плотномеры. Самой популярной и востребованной серией плотномеров и расходомеров Micro Motion является F-линейка массовых кориолисовых устройств. Они совмещаются почти со всеми технологическими средами и точно измеряют массовый/объемный расход газов, жидкостей (в том числе агрессивных), воды, суспензий, масел и т.д. Их можно монтировать без выпрямителей потока и дополнительного регулирующего прибора. Расходомеры F и F300 совмещаются со многими стандартными трансмиттерами Micro Motion, которые устанавливаются в обычных и зонах повышенной опасности. Их сенсоры производятся из стали, никеля и других материалов, что дает возможность совмещать их с любой средой. Еще одно преимущество – нет необходимости в нескольких калибровках. Расходомеры и плотномеры серии Elite Micro Motion (CMF300A, M) имеют минимальные погрешности в измерении га