(1, 1, 'Terms & Conditions', 'terms-conditions', 'Page Terms & Conditions', 'Page, Terms & Conditions', '<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">This website is operated by akyegroup. Throughout the site, the terms &ldquo;we&rdquo;, &ldquo;us&rdquo; and &ldquo;our&rdquo; refer to akyegroup.&nbsp;By visiting our platform and or exchanging&nbsp; something from us, you engage in our &ldquo;Service&rdquo; and agree to be bound by the following terms and conditions referenced through hyperlink or herein. Read it carefully before you proceed to view or sign up with us, These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content.Any new product or services which are added to the&nbsp; platform shall also be subject to the Terms of Service. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Akyegroup is a localized platform for classified bartered goods system and service rendering.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We claim all warranty for our goods 2days after delivery if <strong>conditions of return policy is fulfilled. </strong>Also, we claim warranty for service rendering 3 days after our agent has worked upon a fault yet the fault persist or reoccur, if <strong>&nbsp;conditions of return policy is fulfilled.</strong></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We claim higher purity and legality of goods and services. The trustworthiness or accuracy&nbsp; of information about our platform.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">All merchants must provide receipt or document (s) confirming ownership of goods&nbsp; under applicable requirements of Nigeria law, regulations,rules , guidelines and standards before acceptance for exchange on our platform.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">This platform is an e commerce where sign up and upload of the trade item is done online but merchant comes to office with his /her item and his/her &nbsp;receipt (s) or document (s) as a claim before exchange is accepted for any item.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Akyegroup itself is not an importer , manufacturer,producer or retailer,rather we create a platform where trade is bartered between people under a fair policy as a company.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We disclaim every right to suspend,terminate exchange if at the verification of item or receipt,an arbitration is discovered.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">If at any circumstance, you provided a higher valued good(s) than what you wanted to swap or receive, we are responsible&nbsp; to do the exchange and pay you for overage as the <strong>conditions of exchange is fulfilled. </strong>Also, if you provide a lesser valued good(s) but desire to trade for higher good(s)then the merchant is responsible to pay up the demand(s) of the higher good(s) <strong>if conditions for exchange is fulfilled</strong></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:14.6667px\">Condition for goods exchange</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">1. The good(s) must be valuable to the market trend</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">2. There is a clear and true legal document (s) for ownership</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">3. The condition(s) of the good must be clearly stated and approved by us and if at verification,error is discovered, suspension or termination or devaluation is inevitable</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">4. It must be working.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">5. We pay an overage when item brought is 10%balanced to the item desired</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">By agreeing to these Terms of Service, you represent that you are at least 18 years above or under the supervise of your parental guidance and you have given us your consent to allow any of your minor dependents to use this site.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You may not use our products or services for any illegal or unauthorized purpose nor may you, in the use of the service, violate any laws in Nigeria (including but not limited to copyright laws).&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You must not transmit any worms or viruses or any code of a destructive nature.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">A breach or violation of any of the Terms will result in an immediate termination of your Services.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We reserve the right to refuse service to anyone for any reason at any time.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express written permission by us.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Prices for our products are subject to change without notice. &nbsp;Our valuers is solely responsible for valuing every item brought to us for exchange,any other personnel &nbsp;is at your risk. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We reserve the right ,in our sole discretion to change the fees and acceptable payment method from time to time and for any reason.unless otherwise explicitly provided by mandatory rules of law ,the fees are non refundable due to the nature of online services</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Fees we charged at payable services and for goods are deny for public display but shown at personal contact in our office . This is because different conditions of goods and services are brought to us daily. We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Certain products or services may be available exclusively online through the website. These products or services does not have limited quantities and are subject for &nbsp;exchange.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We have made every effort to display as accurately as possible the colors and images of our products that appear on the platform. We cannot guarantee that your computer or phone display of any color will be accurate.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">&nbsp;All descriptions of products or product pricing and services are subject to change at anytime without notice, at the sole discretion of us. We reserve the right to discontinue any product or service at any time. Any offer for any product or service made on this site is void where prohibited.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or home address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e‑mail or phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by dealers, resellers or distributors.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You agree to provide current, complete and accurate purchase and account information for all purchases made at our platform. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates, so that we can complete your transactions and contact you as needed.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">For more detail, please review our Returns Policy.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 6 - OPTIONAL TOOLS&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We may provide you with access to third-party or links outside our ambiance over which we neither monitor nor have any control nor input.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You acknowledge and agree that we provide access to such tools &rdquo;as is&rdquo; and &ldquo;as available&rdquo; without any warranties, representations or conditions of any kind and without any endorsement. We shall have no liability whatsoever arising from or relating to your use of optional third-party tools.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Any use by you of optional tools offered through the site is entirely at your own risk and discretion and you should ensure that you are familiar with and approve of the terms on which tools are provided by the relevant third-party provider(s).&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We may also, in the future, offer new services and/or features through the website (including, the release of new tools and resources). Such new features and/or services shall also be subject to these Terms of Service.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 7- THIRD-PARTY LINKS&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Certain content, products and services available via our platform may include materials from third-parties.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Third-party links on this site may direct you to third-party websites that are not affiliated with us. We are not responsible for examining or evaluating the content or accuracy and we do not warrant and will not have any liability or responsibility for any third-party materials or websites, or for any other products, or services of third-parties.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites. Please review carefully the third-party&#39;s policies and practices and make sure you understand them before you engage in any transaction. Complaints, claims, concerns, or questions regarding third-party products should be directed to the third-party.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 8 - USER COMMENTS, FEEDBACK AND OTHER SUBMISSIONS&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">If, at our request, you send certain specific submissions (for example contest entries) or without a request from us you send creative ideas, suggestions, proposals, plans, or other materials, whether online, by email, by postal mail, or otherwise (collectively, &#39;comments&#39;), you agree that we may, at any time, without restriction, edit, copy, publish, distribute, translate and otherwise use in any medium any comments that you forward to us. We are and shall be under no obligation; to maintain any comments in confidence; to pay compensation for any comments; or to respond to any comments.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We may, but have no obligation to, monitor, edit or remove content that we determine in our sole discretion are unlawful, offensive, threatening, libelous, defamatory, obscene or otherwise objectionable or violates any party&rsquo;s intellectual property or these Terms of Service.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You agree that your comments will not violate any right of any third-party, including copyright, trademark, privacy, personality or other personal or proprietary right. You further agree that your comments will not contain libelous or otherwise unlawful, abusive or obscene material, or contain any computer virus or other malware that could in any way affect the operation of the Service or any related website.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 9 - ERRORS, INACCURACIES AND OMISSIONS&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Occasionally there may be information on our site or in the Service that contains typographical errors, inaccuracies or omissions that may relate to product descriptions, pricing, promotions, offers, product shipping charges, transit times and availability. We reserve the right to correct any errors, inaccuracies or omissions, and to change or update information or cancel orders if any information in the Service or on any related website is inaccurate at any time without prior notice (including after you have submitted your order).&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We undertake no obligation to update, amend or clarify information on our site or on any related website, including without limitation, pricing information, except as required by law. No specified update or refresh date applied on our site or on any related website, should be taken to indicate that all information on our site or on any related website has been modified or updated.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><strong>SECTION 10 - DISCLAIMER OF WARRANTIES; LIMITATION OF LIABILITY</strong>&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We do not warrant that the results that may be obtained from the use of the service will be accurate.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You agree that from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without notice to you.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You expressly agree that your use of, or inability to use, the service is at your sole risk. The service and all products and services delivered to you through the service are (except as expressly stated by us) provided &#39;as is&#39; and &#39;as available&#39; for your use, without any representation, warranties or conditions of any kind, either express or implied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">In no case shall Akyegroup directors, employees, affiliates, agents, interns, suppliers, service providers or licensors be liable for any injury, loss, claim, or any direct, indirect, incidental, punitive, special, or consequential damages of any kind, including, without limitation lost profits, lost revenue, lost savings, loss of data, replacement costs, or any similar damages, whether based in contract, tort (including negligence), strict liability or otherwise, except stated by us.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 11- INDEMNIFICATION&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">You agree not &nbsp;to indemnify, defend and hold&nbsp;Akyegroup partners, directors, agents, licensors, service providers, suppliers, interns and employees, against any loss,claim or demand, including reasonable attorneys&rsquo; fees, made by you or any third-party due to or arising out of your breach of these Terms of Service or the documents they incorporate by reference, or your violation of any law or the rights of a third-party.&nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">SECTION 12- GOVERNING LAW&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">These Terms of Service and any separate agreements whereby we provide shall be governed by and construed in accordance with the laws of Nigeria.&nbsp;</span></p>\r\n', 1, 1, 1, 'information', NULL, '2018-10-11 21:29:48'),
(2, 1, 'Privacy Policy', 'privacy-policy', 'This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from Akyegroup.com', 'akyegroup,private,data,policy,information', '<p style=\"margin-left:0in; margin-right:0in\">This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from Akyegroup.com</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><strong>Personal information we collect </strong></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, through your browsing device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically-collected information as &ldquo;Device Information&rdquo;.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Additionally when you make attempt to swap through the Site, we collect certain information from you, including your name, residential address, office address, payment information (including credit card numbers), email address, and phone number. We refer to this information as &ldquo;goods &nbsp;Information&rdquo;. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">When we talk about &ldquo;Personal Information&rdquo; in this Privacy Policy, we are talking both about Device Information and goods Information. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">How do we use your personal information? </span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We use the goods Information that we collect generally to fulfill inventory on our database through the Site (including your payment information, arranging for delivery, and providing you with invoices and/or goods confirmations). Additionally, we use this goods Information to: </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">(a) communicate our services or promotional platform to you </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">(b)Screen our inventory for potential risk or fraud.</span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for instance, we &nbsp;can speculate &nbsp;how our customers interact with the Site, and to measure the success of our marketing and advertising campaigns). </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Finally, we may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful request for information we receive, or to otherwise protect our rights. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">Do not track </span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">Please note that we do not alter our Site&rsquo;s data collection and use practices when we see a Do Not Track signal from your browser. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">Data retention </span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">When you place for exchange through the Site, we will maintain your goods Information for our records unless and until you ask us to delete this information. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">Changes </span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">We may update this privacy policy from time to time in order to modify or improve for example, changes to our practices or for other operational, legal or regulatory reasons. </span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><strong><span style=\"font-size:11pt\">Contact us </span></strong></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\">For more information about our privacy practices, if you have questions, or if you would like to make a complaint, please contact us by e‑mail at akyegroup.com</span></p>\r\n', 1, 1, 1, 'quick-links', NULL, '2020-04-15 07:03:09');
